import styles from './NavTextCategories.module.scss';

const NavTextCategories = () => {
  return (
    <div className={styles.main}>
      <div className={`${styles.navButtons}`}>Font</div>
      <div className={`${styles.navButtons}`}>Color</div>
      <div className={`${styles.navButtons}`}>Outline</div>
      <div className={`${styles.navButtons}`}>Finish</div>
    </div>
  );
};

export default NavTextCategories;
